import React from 'react';
import './style.css'

const Footer=()=>{
    return(
        <div className="footer-container">
            <div className="footer-content">
                {/* <div className="footer-content-logo">
                    <img src={Logo} alt=""/>
                </div> */}
            </div>
            <div className="footer-copyright">
                <p>&copy;Copyright Akei 2020</p>
            </div>
        </div>
    )
}

export default Footer
